import React from "react";

function TextField({ label, width, ...props }) {
  return (
    <div className="flex flex-col space-y-1 w-full">
      <label htmlFor="">{label}</label>
      <div>
        <input
          {...props}
          className={`p-2 border-2 border-black w-[300px]`}
          placeholder={label}
        />
      </div>
    </div>
  );
}

export default TextField;
